        if input_string == current_string:
            return True

        if len(input_string) > 10:
            return False

        for i in range(1, len(input_string) + 1):
            prefix = input_string[:i]
            if generate_string(input_string[i:], current_string + prefix):
                return True
        return False

    if generate_string(s, ""):
        print("Yes")
    else:
        print("No")

