def solve():
    s = "t14 t11 t22 t13 t19 t12 t22 t7 t15 t23 t14 t1 t13 t2"

    def check_grammar(grammar, input_string):
        grammar_dict = {}
        for token in grammar:
            grammar_dict[token] = grammar_dict.get(token, 0) + 1

        n = len(input_string)
        dp = [False] * (n + 1)
        dp[0] = True

        for i in range(1, n + 1):
            for j in range(i):
                if dp[j] and input_string[j:i] in grammar_dict:
                    dp[i] = True
                    break

        return dp[n]

    print(check_grammar(s, input_string))

solve()
